import React from "react";
import './note.css'
import {BsFillTrashFill} from 'react-icons/bs'
import {AiFillEdit} from 'react-icons/ai'

const Note = ({id,title,content,onChecked,editNote}) => {
  return (
    <div className="note-container">
      <div className="note">
        <h1>{title}</h1>
        <p>{content}</p>
        <button
          onClick={() => {
            onChecked(id);
            console.log(id)
          }}
        >
        <BsFillTrashFill />
        </button>
        <button onClick={()=>editNote(id)}>
          <AiFillEdit/>
        </button>
      </div>
     </div>
  );
}

export default Note;
